en:
[u]Sail away practice[/u]
Perform the following steps to depart from the float. Sail over the star to end the practice.

1) {PeddelendStrijkenSB} : and end with {Bedankt}  if there is enough space to bring out the oars 
2) {UitbrengenSB} 
3) {StrijkenBB} : when the boat is parallel to the float {Bedankt} 
4) {SlagklaarAf} to depart.

